DROP TABLE IF EXISTS agents;

CREATE TABLE `agents` (
  `id` int(11) NOT NULL auto_increment,
  `name` varchar(100) NOT NULL,
  `email` varchar(50) NOT NULL,
  `phone` varchar(50) NOT NULL,
  `address` varchar(250) NOT NULL,
  `fax` varchar(30) NOT NULL,
  `website` varchar(30) NOT NULL,
  `credit_limit` decimal(10,0) NOT NULL,
  `previous_balance` decimal(11,2) NOT NULL default '0.00',
  `status` varchar(10) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=228 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS banks;

CREATE TABLE `banks` (
  `id` int(11) NOT NULL auto_increment,
  `bank_name` varchar(100) NOT NULL,
  `status` varchar(10) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS carriers;

CREATE TABLE `carriers` (
  `id` int(11) NOT NULL auto_increment,
  `carrier_name` varchar(100) NOT NULL,
  `status` varchar(10) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=31 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS cash_deposit;

CREATE TABLE `cash_deposit` (
  `id` int(11) NOT NULL auto_increment,
  `cash_in_hand` decimal(11,2) default NULL,
  `check_in_hand` decimal(11,2) default NULL,
  `deposit` decimal(11,2) default NULL,
  `che_deposit` decimal(11,2) default NULL,
  `deposit_date` date NOT NULL,
  `cash_credit_cheque_no` int(11) NOT NULL,
  `user_id` int(11) NOT NULL default '0',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS company;

CREATE TABLE `company` (
  `id` int(11) NOT NULL auto_increment,
  `name` varchar(100) NOT NULL,
  `email` varchar(50) NOT NULL,
  `phone` varchar(20) NOT NULL,
  `fax` varchar(30) NOT NULL,
  `address` varchar(250) NOT NULL,
  `website` varchar(50) NOT NULL,
  `img` varchar(100) NOT NULL,
  `mobile` varchar(30) NOT NULL,
  `reg_number` varchar(30) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS db_bck;

CREATE TABLE `db_bck` (
  `id` bigint(20) NOT NULL auto_increment,
  `file_name` varchar(50) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=87 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS due_collection;

CREATE TABLE `due_collection` (
  `id` int(11) NOT NULL auto_increment,
  `payment_date` date NOT NULL,
  `type` varchar(30) NOT NULL,
  `agent_id` int(11) default NULL,
  `carrier_id` int(11) default NULL,
  `bank_id` int(10) NOT NULL,
  `individual` varchar(30) NOT NULL,
  `cash` decimal(11,2) NOT NULL,
  `cheque` decimal(11,2) NOT NULL,
  `bank` decimal(11,2) NOT NULL,
  `total` decimal(11,2) NOT NULL,
  `remarks` text NOT NULL,
  `issued_by` varchar(10) NOT NULL,
  `stamp` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1200 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS exchange_order;

CREATE TABLE `exchange_order` (
  `id` int(11) NOT NULL auto_increment,
  `xo_number` int(11) NOT NULL,
  `xo_to` varchar(200) NOT NULL,
  `date` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,
  `paxs` varchar(100) NOT NULL,
  `ringgit_inwords` varchar(100) NOT NULL,
  `cheque_no` varchar(50) NOT NULL,
  `or_no` varchar(50) NOT NULL,
  `groos_fare` decimal(11,2) NOT NULL,
  `comission` decimal(11,2) NOT NULL,
  `net_fare` decimal(11,2) NOT NULL,
  `tax` decimal(11,2) NOT NULL,
  `total` decimal(11,2) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS info_remark;

CREATE TABLE `info_remark` (
  `id` int(10) NOT NULL auto_increment,
  `type` varchar(300) NOT NULL,
  `name` varchar(300) NOT NULL,
  `field` varchar(1000) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=64 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS invoice;

CREATE TABLE `invoice` (
  `id` int(11) NOT NULL auto_increment,
  `invoice_number` int(11) NOT NULL,
  `invoice_to` varchar(500) NOT NULL,
  `attn` varchar(200) NOT NULL,
  `sector` varchar(20) NOT NULL,
  `carrier` varchar(20) NOT NULL,
  `invoice_date` date NOT NULL,
  `fdate` date NOT NULL,
  `total_amount` decimal(11,2) NOT NULL,
  `issued_by` varchar(10) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS invoice_particular;

CREATE TABLE `invoice_particular` (
  `id` int(11) NOT NULL auto_increment,
  `invoice_number` varchar(30) NOT NULL,
  `particular` varchar(400) NOT NULL,
  `qty` int(11) NOT NULL,
  `rate` decimal(11,2) NOT NULL,
  `total` decimal(11,2) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS menu_action;

CREATE TABLE `menu_action` (
  `id` int(11) NOT NULL auto_increment,
  `menu_id` int(11) NOT NULL,
  `action` varchar(30) NOT NULL,
  `type_id` int(11) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3727 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS menu_item;

CREATE TABLE `menu_item` (
  `id` int(11) NOT NULL auto_increment,
  `name` varchar(50) character set utf8 NOT NULL,
  `link` varchar(100) NOT NULL,
  `parent` int(11) NOT NULL,
  `ordering` int(11) NOT NULL,
  `icon` varchar(40) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS menus;

CREATE TABLE `menus` (
  `id` int(11) NOT NULL auto_increment,
  `name` varchar(50) NOT NULL,
  `path` varchar(100) NOT NULL,
  `order` int(11) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS payment_details;

CREATE TABLE `payment_details` (
  `id` int(11) NOT NULL auto_increment,
  `agent_name` varchar(20) NOT NULL,
  `amount` int(11) NOT NULL,
  `date` varchar(11) NOT NULL,
  PRIMARY KEY  (`id`,`agent_name`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS payment_terms;

CREATE TABLE `payment_terms` (
  `id` int(11) NOT NULL auto_increment,
  `payment_term_name` varchar(100) NOT NULL,
  `status` varchar(10) NOT NULL,
  `status_b` varchar(10) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS payment_voucher;

CREATE TABLE `payment_voucher` (
  `id` int(11) NOT NULL auto_increment,
  `payment_date` date NOT NULL,
  `type` varchar(30) NOT NULL,
  `agent_id` int(11) default NULL,
  `carrier_id` int(11) default NULL,
  `individual` varchar(30) NOT NULL,
  `payment_terms` varchar(20) NOT NULL,
  `bank_id` int(11) NOT NULL,
  `cheque_no` varchar(50) NOT NULL,
  `cheque_date` date NOT NULL,
  `total` decimal(11,2) NOT NULL,
  `auto_num` int(11) NOT NULL,
  `status` varchar(20) NOT NULL default 'Pending',
  `approved_by` int(11) NOT NULL default '0',
  `purpose` varchar(100) NOT NULL,
  `stamp` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS prices;

CREATE TABLE `prices` (
  `id` int(11) NOT NULL auto_increment,
  `sector_id` int(11) NOT NULL,
  `carrier_id` int(11) NOT NULL,
  `original_price` decimal(10,2) NOT NULL,
  `selling_price` decimal(10,2) NOT NULL,
  `status` varchar(10) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=239 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS privileges;

CREATE TABLE `privileges` (
  `user_id` int(11) NOT NULL,
  `menu_id` int(11) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS receipts;

CREATE TABLE `receipts` (
  `id` int(11) NOT NULL auto_increment,
  `mode` varchar(10) NOT NULL,
  `advance` decimal(10,2) NOT NULL,
  `balance` decimal(10,2) NOT NULL,
  `bal_con` decimal(10,2) NOT NULL,
  `auto_num` int(11) NOT NULL,
  `origin` int(11) NOT NULL,
  `pnr` varchar(50) NOT NULL,
  `date` date NOT NULL,
  `flt_date` date NOT NULL,
  `return_date` timestamp NOT NULL default '0000-00-00 00:00:00',
  `name_prefix` varchar(10) NOT NULL,
  `name` varchar(300) NOT NULL,
  `ticket_no` varchar(300) NOT NULL,
  `sector` varchar(20) NOT NULL,
  `carrier` varchar(20) NOT NULL,
  `agent_id` int(11) NOT NULL,
  `cash_credit_cheque_no` int(11) default NULL,
  `op` decimal(11,2) NOT NULL,
  `rm` decimal(10,2) default NULL,
  `remarks` varchar(250) NOT NULL,
  `profit` decimal(10,2) NOT NULL,
  `bank_id` int(11) NOT NULL,
  `cheque_no` varchar(100) NOT NULL,
  `cheque_date` date NOT NULL,
  `customer_id` int(11) NOT NULL,
  `xo` varchar(50) NOT NULL,
  `no_of_tickets` varchar(30) NOT NULL default '1',
  `issued_by` varchar(10) NOT NULL,
  `stamp` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=12874 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS receipts_passanger;

CREATE TABLE `receipts_passanger` (
  `id` int(10) NOT NULL auto_increment,
  `receipt_no` int(11) NOT NULL,
  `date` date NOT NULL,
  `pnr` varchar(6) NOT NULL,
  `ticket_no` varchar(300) NOT NULL,
  `prefix` varchar(10) NOT NULL,
  `name` varchar(300) NOT NULL,
  `cost` decimal(10,2) NOT NULL,
  `sell` decimal(10,2) NOT NULL,
  `advance` decimal(10,2) NOT NULL,
  `r_status` varchar(20) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=539 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS refund;

CREATE TABLE `refund` (
  `id` int(10) NOT NULL auto_increment,
  `rdate` date NOT NULL,
  `receipt_no` int(10) NOT NULL,
  `name` varchar(300) NOT NULL,
  `ticket_no` bigint(13) NOT NULL,
  `or_no` varchar(15) NOT NULL,
  `carrier` int(10) NOT NULL,
  `contact` varchar(15) NOT NULL,
  `ra_no` varchar(20) NOT NULL,
  `remarks` varchar(300) NOT NULL,
  `status` varchar(30) NOT NULL,
  `received_amount` decimal(10,2) NOT NULL,
  `paid_amount` decimal(10,2) NOT NULL,
  `issued_by` varchar(30) NOT NULL,
  PRIMARY KEY  (`id`),
  UNIQUE KEY `ticket_no` (`ticket_no`),
  UNIQUE KEY `ticket_no_2` (`ticket_no`)
) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS sectors;

CREATE TABLE `sectors` (
  `id` int(11) NOT NULL auto_increment,
  `sector_name` varchar(100) NOT NULL,
  `status` varchar(10) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=194 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS serial_number;

CREATE TABLE `serial_number` (
  `id` int(11) NOT NULL auto_increment,
  `receipt` int(11) NOT NULL,
  `payment_voucher` int(11) NOT NULL,
  `invoice` int(11) NOT NULL,
  `xo` int(11) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS user_group;

CREATE TABLE `user_group` (
  `id` int(11) NOT NULL auto_increment,
  `group_name` varchar(30) NOT NULL,
  `status` varchar(20) NOT NULL default 'ACTIVE',
  `menu_permission` varchar(200) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS user_info;

CREATE TABLE `user_info` (
  `id` int(11) NOT NULL auto_increment,
  `fullname` varchar(100) NOT NULL,
  `date_of_birth` timestamp NOT NULL default '0000-00-00 00:00:00',
  `phone` varchar(20) NOT NULL,
  `email` varchar(50) NOT NULL,
  `address` varchar(300) NOT NULL,
  `user_name` varchar(20) NOT NULL,
  `password` varchar(100) NOT NULL,
  `status` varchar(10) NOT NULL default 'ACTIVE',
  `entry_date` timestamp NOT NULL default CURRENT_TIMESTAMP,
  `entry_by` varchar(100) NOT NULL,
  `update_date` timestamp NOT NULL default '0000-00-00 00:00:00',
  `update_by` varchar(100) NOT NULL,
  `menu_permission` varchar(200) NOT NULL,
  `type_id` int(11) NOT NULL,
  `avatar` varchar(100) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS user_log;

CREATE TABLE `user_log` (
  `id` int(11) NOT NULL auto_increment,
  `type` varchar(20) NOT NULL,
  `user_id` int(11) NOT NULL,
  `description` varchar(100) NOT NULL,
  `log_time` timestamp NOT NULL default CURRENT_TIMESTAMP,
  `table_name` varchar(20) NOT NULL,
  `table_id` varchar(10) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=35127 DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS users;

CREATE TABLE `users` (
  `id` int(11) NOT NULL auto_increment,
  `user_id` varchar(50) NOT NULL,
  `password` varchar(50) NOT NULL,
  `full_name` varchar(50) NOT NULL,
  `dob` date NOT NULL,
  `email` varchar(50) NOT NULL,
  `status` varchar(10) NOT NULL default 'Inactive',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS xo_multi;

CREATE TABLE `xo_multi` (
  `id` int(11) NOT NULL auto_increment,
  `xo_number` varchar(30) NOT NULL,
  `routing` varchar(100) NOT NULL,
  `flight_no` varchar(20) NOT NULL,
  `date_of` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,
  `time` varchar(20) NOT NULL,
  `status` varchar(50) NOT NULL,
  `remarks` varchar(100) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;




